import "./header.css";

function Header() {
  return (
    <div className="header">
      <div className="headerTitles">
        <span className="headerTitle">React&Node</span>
        <span className="headerTitleBlog">Blog</span>
      </div>
      <img className="headerImg" src="" />
    </div>
  );
}

export default Header;
